&quot;Wanna be my new mom or dad? I&#39;ll promise to love you unconditionally and give you lots of kisses! I LOVE playing outside with my new friend, Gilley, and I especially love chasing her cat brother, Sam. I&#39;ve learned pretty quickly not to do my business in the house or my crate. (Paws crossed my new family lets me sleep in the bed). I&#39;m a 6 month old ( as of &nbsp;the end of April) blue eyed Husky/Border Collie mix who loves car rides, is fun loving, and cuddly too! I am a friend to all, dogs, cats, and kids! My adoption fee of $200, which includes spay, microchip, and vaccinations up to date.&nbsp;

