Meet Herb, the many-toed cat!&nbsp; The cat with ginormous paws!&nbsp; Herb is a cat like you&rsquo;ve never met before.&nbsp; He loves to play fetch, is super affectionate, has a purr that will wake you up in the morning, and&hellip;did I mention those paws?&nbsp; He loves to climb high places, look out the window to see the goings-on, lie in the sun, and groom those gigantic paws.&nbsp; He is tall and lean and long, and he has beautiful eyes as well.&nbsp;

One of Herb&rsquo;s favorite activities is fetching plastic shower rings.&nbsp; You throw, he fetches and brings it back to you. Endless amusement!&nbsp; Of course he loves all other kinds of cat toys &ndash; feathers, laser dots, cat dancers, foil balls, catnip!&nbsp; He uses the cardboard scratching post like a champ. I have never seen him scratch furniture.&nbsp; In the morning when he hears you stirring, he will come in, sit on your chest, and purr, purr, purr while you pet him.&nbsp; It&rsquo;s quite a lovely way to start the day.

Herb likes to eat, so you better be ready with his food at mealtime or he&rsquo;ll let you know to step on it!&nbsp; He currently lives in a house with two small dogs and several cats.&nbsp;&nbsp; He gets along fine with all them and sometimes naps with one of the cats.&nbsp;

One thing about all those toes, you will need to be comfortable clipping his nails because the extra one will become ingrown and will require a vet visit if you don&rsquo;t.&nbsp; Fortunately, Herb is very good natured and will allow you to clip his claws. &nbsp;

&nbsp;Meet Sparkle... she is a sweet adorable little girl. she got her name from the sparkles in her eyes when she see you coming! She is very loving, and still has puppy energy. Her coat is a beautiful black/ tan, and so soft. She is good with other puppies in rescue. She is about 5 months old, and 18 lbs. She is spayed, current with vacc. and her monthly preventions.&nbsp; ME 5/14/16
