Bentley's owner got him from a family member but was allergic and couldn't keep him so he brought him to YWAC on April 19 and surrendered him for adoption.&nbsp; Bentley is about 4 years old.&nbsp; He is front declawed and blind in both eyes.&nbsp; He needs a quiet home where things stay the same and he can find his way around.&nbsp; Bentley is fearful at first but if spoken to quietly and given time to become familiar with your voice and know that he can trust you, he is quite friendly and once he gains trust he loves to snuggle. He has to get used to your voice and he'll love you forever. He's shy at first but once he warms up to you he loves giving head bumps and kisses.
&nbsp;
