Hello! &nbsp;My name is Clara&nbsp;and I am about a year&nbsp;old. &nbsp;I&#39;m a friendly petite kitty. &nbsp;I will purr up a storm and rub against you until you love and pet me. &nbsp;I love sitting next to people or on their lap - I&#39;m a lover!&nbsp; &nbsp;I&#39;m ok with being&nbsp;picked&nbsp;up, held, and carried&nbsp;around. &nbsp;Don&#39;t forget to pet and scratch me - its my favorite. &nbsp;I absolutely&nbsp;love looking out windows - its my version of tv&nbsp;- so much to see!&nbsp;&nbsp;I like toys and still have a little &quot;kitten&quot; energy in me! &nbsp;&nbsp; Don&#39;t be surprised&nbsp;if I snuggle up in bed with you!&nbsp;&nbsp;I am young and have many playful years ahead of me. &nbsp;I get along with&nbsp;other cats. &nbsp; I was found as a pregnant stray in the&nbsp;twin cities. &nbsp;Luckily, I was brought into Twin Cities Pet Rescue and was able to have my four babies in a safe, warm home. I even took on two&nbsp;orphaned kittens - for a total of six.&nbsp;&nbsp;I was a really good mom, but they are all grown up now and I am ready for a home of my own.


I am spayed, vaccinated for Distemper and Rabies, dewormed, micrcochipped, and Feline and FIV negative. &nbsp;



Adopt Me: To meet me or learn more about me, please complete an Adoption Application at www.tcpetrescue.org/adopt/adopt-a-cat. If you have general questions about me, you may email cats@tcpetrescue.org.



