Tessa is a 2 year old female French bulldog.&nbsp; She is house-trained, rides well in a car and even enjoys trips in a travel trailer.&nbsp; She has been at the lake and around water, and even on a boat on occasion.&nbsp; Tessa likes to go jogging and is a very active little girl.&nbsp; Tessa has a rough start in life, purchased as a possible breeding female for a puppy mill, she ended up chained in a back yard and was covered in fleas and ticks.&nbsp; She is now healthy but, like many dogs, needs a corn and grain free diet.&nbsp; Tessa was pretty thin when she was rescued, and we think this is what motivates her to guard food, treats and sources of food and treats.&nbsp; Even the dishwasher!&nbsp; Tessa can&rsquo;t be with other dogs because she will attack to protect what she feels is life or death food or food sources.&nbsp; But, she&rsquo;s adorable, and in a home with no other dogs, she&rsquo;ll be a great pet.&nbsp; We think that she would be best with older children only as well.&nbsp; Tessa&rsquo;s $500 adoption fee is being donated as a medical fundraiser for other dogs in Pet Allies care.&nbsp; Dogs like Weeble who needed a wheelchair, and Hops who was hit by a car.&nbsp;&nbsp; Tessa&#39;s vaccines are current and she has be spayed and has her micro-chip.&nbsp; Call 928-537-8009 to make an appointment to meet Tessa.


