Amanda Puerto Rico was born about April 12, 2010 and weighs about 18 lbs.&nbsp; She could stand to gain a couple now that her breeding days are over.&nbsp; This little girl came all the way from Puerto Rico in cargo and her foster mom, Guanina/Nina sent a beautiful note of appreciation that she would like passed on to Amanda's forever family.&nbsp; She stated that Amanda suffered a lot and "she was used just to have puppies in exchange for money".&nbsp; She was bred to the extent that Jeanne, the volunteer who picked her up from the airport, sent a photo of her vulva thinking it was a tumor or something.&nbsp;&nbsp; I had to explain that she was just over used and how sad is it that I've seen that so many times I knew immediately what had happened to her before reading the note from her P.R. foster mom.&nbsp; Amanda ADORES her humans and has been, absolutely, wonderful with all the other dogs, her temperament is beyond amazing.&nbsp; She loves belly rubs and snoozing on a lap is her favorite sport besides wiggling her little tail anytime you look her way.&nbsp; Her P.R. foster mom said she is good with cats, kids, and house trained.&nbsp; Puerto Rico has a dog over population problem and that is why they try desperately to send some to the mainland in areas such as ours where the population problem of nice, family, dogs is pretty well under control.&nbsp; Welcome Amanda! The Adoption Fee for this dog is $300.00.
