Greyhound Adoption League of Texas, Inc. (GALT) is an all-volunteer 501(c)3 non-profit corporation operating in the Dallas/Fort Worth metroplex, throughout Texas and the United States since May, 2001. GALT has assisted more than 2400 greyhounds in finding their forever homes.

GALT depends solely on donations for its operating budget of more than $350,000 per year for needs of the greyhounds in its possession. GALT takes a neutral stand on greyhound racing.

Our Mission
Assist all greyhounds, primarily those that are retired from or affiliated with the racing industry;
Facilitate placing greyhounds in loving, responsible, forever homes;
Educate the public about the desirability of adopting greyhounds as companions and family pets in the home;
Stress the importance of spay and neuter as a means of controlling the number of unwanted animals;
Support, welcome and encourage an active, organized volunteer base of greyhound lovers who share the passion and vision of finding loving, responsible, forever homes for greyhounds to live out their natural lives;
Provide continuing educational support to the greyhound's family after placement to ensure a successful adoption;
Connect with other groups and people that assist and adopt greyhounds to promote adoption worldwide; and most of all,
Enjoy the spiritual connection we all share with greyhounds and each other in loving and helping one of the most loving and loyal creatures put on this earth.

The Calhoun County Humane Society, Inc. (dba The Animal Shelter), located in Anniston, Alabama, was established in 1973 as a result of the efforts of Susan Levens Phillips. 

Our mission is 

**To provide the pets in our care with a decent, safe and sanitary place;
**To prevent cruelty to animals;
**To stop suffering among animals mutilated or injured;
**To educate the public about the tremendous pet over-population facing the United States;
**To promote spaying and neutering to stop the senseless killing of animals;
**To place as many pets as possible in responsible homes.
